import "./App.css";
import Header from "./MyComponents/Header";
import {Todos} from "./MyComponents/Todos";
//import TodoItem from "./MyComponents/TodoItem";
import {Footer} from "./MyComponents/Footer";

function App() {
  let todos =[
    {
      sno:1,
      title: "Wake up",
      desc: " You need to wake up to brush your teeth"
    },
    {
      sno:2,
      title: "Drink water",
      desc: " You need to drink water after brushing your teeth"
    },
    {
      sno:1,
      title: "Meditate",
      desc: " You need to go meditate after drinking water"
    },
  ]
  return (
    <>
      <Header title="My Todos List" searchBar={false} />
      <Todos todos={todos} />
      <TodoItem/>
      <Footer />
    </>
  );
}

export default App;
